float curvature(vec2 uv, float epsilon) {
	vec2 eps = vec2(epsilon, 0.0);
	vec3 dp;
	dp = (texture(mesh_inv_uv_tex, uv+eps).xyz-texture(mesh_inv_uv_tex, uv-eps).xyz)*mesh_aabb_size;
	float curvature = length(texture(mesh_normal_tex, uv+eps).xyz-texture(mesh_normal_tex, uv-eps).xyz)/max(epsilon, length(dp));
	dp = (texture(mesh_inv_uv_tex, uv+eps).xyz-texture(mesh_inv_uv_tex, uv-eps).xyz)*mesh_aabb_size;
	curvature = max(curvature, length(texture(mesh_normal_tex, uv+eps.yx).xyz-texture(mesh_normal_tex, uv-eps.yx).xyz)/max(epsilon, length(dp)));
	return curvature;
}

float curvature2(vec2 uv, float epsilon) {
	vec2 eps = vec2(epsilon, 0.0);
	vec3 dp;
	dp = (texture(mesh_inv_uv_tex, uv+eps).xyz-texture(mesh_inv_uv_tex, uv-eps).xyz)*mesh_aabb_size;
	float curvature = dot(texture(mesh_normal_tex, uv+eps).xyz-texture(mesh_normal_tex, uv-eps).xyz, dp);
	dp = (texture(mesh_inv_uv_tex, uv+eps.yx).xyz-texture(mesh_inv_uv_tex, uv-eps.yx).xyz)*mesh_aabb_size;
	curvature = 
	curvature+dot(texture(mesh_normal_tex, uv+eps.yx).xyz-texture(mesh_normal_tex, uv-eps.yx).xyz, dp);
	return curvature;
}

float filter_angle(vec3 input_normal, vec3 ref_vector, float max_angle, float smoothness) {
	return 1.0-clamp((cos(max_angle*0.01745329251)-dot(normalize(input_normal), normalize(ref_vector)))/smoothness, 0.0, 1.0);
}

vec3 brush_flatten(vec2 uv, vec3 v) {
	//return texture(mesh_normal_tex, uv).rgb;
	vec3 mesh_normal = normalize(texture(mesh_normal_tex, uv).rgb*2.0-vec3(1.0));
	vec3 mesh_tangent = normalize(texture(mesh_tangent_tex, uv).rgb*2.0-vec3(1.0));
	vec3 mesh_bitangent = cross(mesh_normal, mesh_tangent);
	return vec3(0.5)+0.5*normalize(v*vec3(dot(view_vector, mesh_tangent), dot(view_vector, mesh_bitangent), dot(view_vector, mesh_normal)));
}
